import React, { useState } from 'react';
import injectLogonStyles from './styles';

injectLogonStyles();

export default function Logon({ onLogin }: { onLogin: (user: { name: string }) => void }) {
  const [name, setName] = useState('');

  return (
    <div className="logon-root">
      <div className="logon-card">
        <h2>Entrar</h2>
        <div className="field">
          <label>Nome</label>
          <input value={name} onChange={e => setName(e.target.value)} placeholder="Seu nome" />
        </div>
        <div className="actions">
          <button className="primary" onClick={() => onLogin({ name: name || 'Usuário' })}>Entrar</button>
        </div>
      </div>
    </div>
  );
}
